import React from "react";

class Navbar extends React.Component{
    render(){
        return(
            <nav>
                <div className="main-wrapper">
                    
                    <a className="logo"><b>NewsBix</b></a>
                    

                    
                </div>
            </nav>
        );
    }
}

export default Navbar;
